export default function Header() {
    const buttons = ["Timer", "Countdown"];
    return (
      <header>
        <img src="/react-logo.png" alt="react logo" />
        <nav>
          {buttons.map((nav) => (
            <NavButton nav={nav} key={nav} />
          ))}
        </nav>
      </header>
    );
  }
